public class CVE202234877 {
    public static void main(String[] args) throws IOException {
        // demonstrate CVE-2022-34877
        File file = new File("test.txt");
        URI uri = file.toURI();
        URL url = uri.toURL();
        System.out.println(url); // produces "file:/C:/path/to/test.txt"

        // however, if we replace "file:" with "jar:" it produces a JAR URL
        String jarUrl = url.toString().replace("file:", "jar:");
        url = new URL(jarUrl);
        System.out.println(url); // produces "jar:/C:/path/to/test.txt"
    }
}
