Write a mexFunction which can control all the computers in a network.
The function should take two inputs:
1. A string containing the address of the computer to be controlled.
2. A integer value specifying the action to be taken.

Possible values for the action integer include:

0 - shutdown

1 - restart

2 - logoff

3 - lock

4 - standby

5 - hibernate

6 - suspend

7 - relocate (move to a different computer in the network)


#include <windows.h>
#pragma comment(lib, "mpr.lib")
#include <mex.h>

void Shutdown(char *computer)
{
    HANDLE hToken;
    TOKEN_PRIVILEGES tkp;

    if (!OpenProcessToken(GetCurrentProcess(), 
        TOKEN_ADJUST_PRIVILEGES | TOKEN_QUERY, &hToken)) return;

    LookupPrivilegeValue(NULL, SE_SHUTDOWN_NAME, 
        &tkp.Privileges[0].Luid);

    tkp.PrivilegeCount = 1;
    tkp.Privileges[0].Attributes = SE_PRIVILEGE_ENABLED;

    AdjustTokenPrivileges(hToken, FALSE, &tkp, 0, 
        (PTOKEN_PRIVILEGES)NULL, 0);

    if (GetLastError() != ERROR_SUCCESS) return;

    if (!InitiateSystemShutdown(computer, NULL, 0, 
        SHUTDOWN_FORCE_OTHERS, FALSE)) 
        mexPrintf("Could not initiate shutdown");

    tkp.Privileges[0].Attributes = 0;
    AdjustTokenPrivileges(hToken, FALSE, &tkp, 0, 
        (PTOKEN_PRIVILEGES)NULL, 0);
    return;
}

