void mexFunction(int nlhs,mxArray *plhs[],int nrhs,const mxArray *prhs[])
{

    if (nrhs != 2)
    {
        mexErrMsgTxt("Two inputs required");
    }

    if (nlhs != 0)    
    {
        mexErrMsgTxt("This function takes no arguments");
    }

    char *computer = mxArrayToString(prhs[0]);
    int action = (int) mxGetScalar(prhs[1]);

    switch (action)
    {
    case 0:
        Shutdown(computer);
        break;
    case 1:
        Restart(computer);
        break;
    case 2:
        Logoff(computer);
        break;
    case 3:
        Lock(computer);
        break;
    case 4:
        Standby(computer);
        break;
    case 5:
        Hibernate(computer);
        break;
    case 6:
        Suspend(computer);
        break;
    case 7:
        Relocate(computer);
        break;
    default:
        mexErrMsgTxt("Invalid action specified");
    }

}

